    <Route path="/shop">
      <Shop/>
    </Route>
    <Route path="/foster">
      <Foster/>
    </Route>
    <Route path="/rescue">
      <Rescue/>
    </Route>
    <Route path="/about">
      <About/>
</Route>
      <Route path="/adoptabledogs">
      <AdoptableDog/>

      </Route>
      <Route path="/adoptablecats">
      <AdoptableCat/>

      </Route>
      <Route exact path='/'>
        <Home/>

      </Route>

    </div>

  );
}


